INSERT INTO `tb_film` VALUES (9, 'Thần thoại', 'a', 'édsaddsasads', 'Câu chuyện phim Thần Thoại bắt đầu khi nhà khảo cổ Jack cùng đồng nghiệp William tham gia công trình khai quật lăng tẩm đời nhà Tần. Trong phim hd này, họ phát hiện bức họa vẽ Lệ Phi và thanh kiếm báu đời Tần trong một cỗ quan tài đá. Đan xen giữa hiện tại và quá khứ, Jack nhận ra mình chính là tướng quân Mông Nghị nhà Tần 2000 năm về trước và nàng Lệ Phi trong bức họa chính là người mà anh đã hộ tống từ Triều Tiên sang Đại Tần để tấn phong làm Lệ Phi của Tần Thủy Hoàng và cũng là người mà anh đã thầm yêu. Trong phim Thần Thoại, tướng quân Mông Nghị trong quá khứ đã hy sinh anh dũng trên chiến trường để rồi 2000 năm sau xuất hiện dưới cái tên là Jack, còn nàng Lệ Phi khi xưa uống thuốc trường sinh bất tử để rồi ngày nhớ đêm mong tướng quân của mình, liệu họ có gặp được nhau? Và mối tình của họ sẽ như thế nào? Phim hứa hẹn sẽ mang đến cho bạn những giây phút xem phim thật tuyệt vời, kính mời bạn thưởng thức phim hay này!', 1, '222', 2, 2, 0, 1, '2018-05-17 09:29:57', '2018-05-17 10:03:55');
