INSERT INTO `tb_film` VALUES (15, 'deadpool 2', 'Deadpool', 'https://ia.media-imdb.com/images/M/MV5BMjI3Njg3MzAxNF5BMl5BanBnXkFtZTgwNjI2OTY0NTM@._V1_UX182_CR0,0,182,268_AL_.jpg', '', 1, '000', 1, 2, 0, 1, '2018-05-20 03:35:39', '2018-05-22 12:50:48');
INSERT INTO `tb_film` VALUES (17, 'infinity war', 'infinity war', 'https://ia.media-imdb.com/images/M/MV5BMjMxNjY2MDU1OV5BMl5BanBnXkFtZTgwNzY1MTUwNTM@._V1_UX182_CR0,0,182,268_AL_.jpg', 'Khi anh hùng Adam Warlock sở hữu vật thể được gọi là Infinity Gauntlet, anh ta trục xuất các khía cạnh tốt và xấu xa của bản thể mình để trở thành một sinh vật hoàn toàn hợp lý, người có thể sử dụng Gauntlet một cách khôn ngoan. Hành động này tái tạo lại nhân vật \"ác\" và kẻ thù cũ của anh, Magus, người mong muốn chinh phục phổ quát và trả thù Warlock và Titan Thanos. (Trong khi đó, Adam vô cảm có hiệu quả được đưa ra trước một \"bồi thẩm đoàn\" của các cường quốc vũ trụ và tự nguyện từ bỏ vị thần của mình một khi anh ta bị coi là \"có tội\" không xứng đáng. [1]) Magus thu thập năm đơn vị ngăn chặn vũ trụ (tên khác cho các khối vũ trụ), và với sức mạnh thu được bất khả xâm phạm thực thể vũ trụ Eternity; tạo ra một vương quốc đa chiều và một đội quân doppelgängers — những hình ảnh \"phản chiếu\" ác của các siêu anh hùng của Trái Đất.\r\n\r\nSau khi điều tra năng lượng của các đơn vị ngăn chặn, Thanos phát hiện ra Magus và rút lui để cảnh báo Warlock. Galactus và một số anh hùng của Trái đất cũng điều tra và sau đó cố gắng hồi sinh Eternity, vì thực thể sẽ được yêu cầu khởi kiện Tòa án sống, người đã quyết định rằng các viên ngọc Infinity không còn có thể được sử dụng đồng loạt trong vũ trụ Earth-616. Lý do là nếu Gauntlet có thể được kích hoạt lại, thì Magus có thể được loại bỏ khỏi sự tồn tại. Magus gửi các doppelgängers đến Trái đất để đánh lạc hướng các anh hùng, và phiên bản ác của Mister Fantastic phát nổ một quả bom gamma khi các anh hùng tập hợp tại Four Freedoms Plaza. Tuy nhiên, người phụ nữ vô hình chứa vụ nổ trong khi Thunder God Thor chỉ đạo bức xạ vào không gian, và một cuộc tấn công bất ngờ của Magus và doppelgänger của Thanos có những anh hùng tin rằng hai nhân vật bây giờ là đồng minh.\r\n\r\nCâu chuyện cao trào tại căn cứ của Magus: một nhóm các anh hùng miễn phí những người được thay thế bởi doppelgängers; nhà thám hiểm vũ trụ Quasar đến cùng với Ultimate Nullifier (với Thanos đi ngược Quasar để sử dụng nó chống lại Magus biết rằng Quasar cũng sẽ bị phá hủy) và nhân vật phản diện Kang the Conqueror và Doctor Doom xuất hiện, hy vọng khai thác nguồn năng lượng mạnh được phát hiện.\r\n\r\nWarlock và Gauntlet vẫn không hoạt động được bắt bởi Magus, và cả hai bị tấn công bởi Doom và Kang. Warlock bị đánh bại và Magus bị suy yếu nghiêm trọng trong trận chiến và cố gắng sử dụng các đơn vị ngăn chặn nhưng phát hiện ra họ đã bị đánh cắp. Doom phản bội và dừng Kang, và sau đó yêu cầu Gauntlet từ Magus. Eternity, tuy nhiên, vừa được hồi sinh và đã yêu cầu Gauntlet được kích hoạt lại, mà Tòa án sống đồng ý. Một Magus toàn năng rõ ràng dễ dàng đánh bại Doom và giải tán Quasar, người đến cùng với Ultimate Nullifier. Thanos đánh bại kẻ thù của mình và làm sao lãng Magus, cho phép Warlock vật lộn với nhân vật phản diện cho Gauntlet. Warlock phát hành từ Gauntlet là một hỗn hợp của thực thể Eternity và người anh em sinh đôi của anh, Infinity. Sự bất khả xâm phạm Magus, cho phép Warlock hấp thụ Magus vào Soul Gem. Kinh nghiệm đặt Warlock trong tình trạng hôn mê.\r\n\r\nThanos tiết lộ cho các anh hùng lắp ráp rằng Magus đã bị lừa và không bao giờ giành được quyền năng toàn năng như Gem thực tế trên Gauntlet - mà Thanos được tiết lộ là người bảo vệ bí mật của — là một giả mạo thuyết phục. Các anh hùng trở về Trái đất và trang cuối cùng của số báo cuối cùng cho thấy rằng các đơn vị ngăn chặn đã bị đánh cắp bởi tính cách \"tốt\" của Warlock, nữ thần. Bên cạnh những phát triển này, Eternity — được Toà án sống thực hiện để đưa ra một nghị định - sau đó tuyên bố rằng các Gems trên Gauntlet sẽ không bao giờ có thể được sử dụng lại như một đơn vị duy nhất, bất kể khủng hoảng trong tương lai trở thành vũ trụ.', 1, '023', 1, 2, 0, 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
